	add("discourse", "{\"term\":\"discourse\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027discours\u0027 from Middle french (ca. 1400-1600) \u0027discours\u0027 (conversation, speech) from \u0027discursus\u0027 (the act of running about) from Latin {{m|la|discurrō||run about}}, from \u0027dis-\u0027 (apart) + {{m|la|currō||run}}. Spelling modified by influence of Middle french (ca. 1400-1600) \u0027cours\u0027 (course)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Verbal exchange, conversation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1847\u0027\u0027, , Chapter XVII\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Two or three of the gentlemen sat near him, and I caught at times scraps of their conversation across the room. At first I could not make much sense of what I heard; for the \u0027\u0027discourse\u0027\u0027 of Louisa Eshton and Mary Ingram, who sat nearer to me, confused the fragmentary sentences that reached me at intervals\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Expression in words, either speech or writing\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A formal lengthy exposition of some subject, either spoken or written\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The preacher gave us a long \u0027\u0027discourse\u0027\u0027 on duty\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Any rational expression, reason\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"difficult, strange, and harsh to the \u0027\u0027discourses\u0027\u0027 of natural reaso\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Sure he that made us with such large \u0027\u0027discourse\u0027\u0027, / Looking before and after, gave us not / That capability and godlike reason / To rust in us unused\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"An institutionalized way of thinking, a social boundary defining what can be said about a specific topic (after w:Michel Michel Foucault\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Christine L. Marran, \u0027Poison Woman: Figuring Female Transgression in Modern Japanese Culture\u0027 (page 137\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Furthermore, it should be recalled from the previous chapter that criminological \u0027\u0027discourse\u0027\u0027 of the 1930s deemed every woman a potential criminal, implicitly including the domestic woman\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jane Anna Gordon, Lewis Gordon, \u0027A Companion to African-American Studies\u0027 (page 308\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"But equally important to the emergence of uniquely African-American queer \u0027\u0027discourses\u0027\u0027 is the refusal of African-American movements for liberation to address adequately issues of sexual orientation and gender identity\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Dealing; transaction\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Beaumont and Fletche\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Good Captain Bessus, tell us the \u0027\u0027discourse\u0027\u0027 / Betwixt Tigranes and our king, and how / We got the victory\", \"priority\":18}]}, \"synonyms\":{}}");

