	add("discovery", "{\"term\":\"discovery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something discovered\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"This latest \u0027\u0027discovery\u0027\u0027 should eventually lead to much better treatments for disease\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The discovering of new things\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The purpose of the voyage was \u0027\u0027discovery\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"automatic \u0027\u0027discovery\u0027\u0027 of RSS feeds by a Web browser\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A pre-trial phase in which evidence is gathered\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The prosecution moved to suppress certain items turned up during \u0027\u0027discovery\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Materials revealed to the opposing party during the pre-trial phase in which evidence is gathered\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The defense argued that the plaintiff\u0027s \u0027\u0027discovery\u0027\u0027 was inadequate\", \"priority\":9}]}, \"synonyms\":{}}");

