	add("discursion", "{\"term\":\"discursion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|discursiō}}, from {{m|la|discurrō||I run to and fro}}; compare the English \u0027discurre\u0027 \u0027discurrent\u0027 \u0027discursation\u0027 and \u0027discurse\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The action of hurriedly moving hither and thither\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Digression\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Ratiocination\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"step by step philosophic reasoning, as opposed to intuition (compare Iamblichus\", \"priority\":4}]}, \"synonyms\":{}}");

