	add("discus", "{\"term\":\"discus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"1656. From Latin \u0027discus\u0027 from Ancient greek (to 1453) \u0027δίσκος\u0027 (disk, quoit, platter)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A round plate-like object that is thrown for sport\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Frank Fitzpatrick, \u0026quot;The amazing story of the first discus medal winner\u0026quot;, \u0027The Philadelphia Inquirer\u0027, August 18\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He [\u0026lt;nowiki/\u0026gt;w:Robert Robert Garrett] won even though he hadn\u0027t ever touched a real \u0027\u0027discus\u0027\u0027 until just before the event was held\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, John Branch, \u0026quot;[http://www.nytimes.com/2008/08/24/sports/olympics/24thrower.html Estonia\u0027s Kanter Celebrates Gold Medal in the Discus His Way]\u0026quot;, \u0027The New York Times\u0027, August 23\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Gerd] Kanter had agreed to demonstrate his throwing skill on Friday, but rather than bringing his own \u0027\u0027discuses\u0027\u0027—he usually travels with about five of them\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The athletics sport of discus throwing\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, \u0026quot;[http://news.bbc.co.uk/sport2/hi/other_sports/disability_sport/7604617.stm Weir lays down marker in Beijing]\u0026quot;, \u0027BBC\u0027, September 8\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"And Chris Martin took a silver medal in the \u0027\u0027discus\u0027\u0027 on the opening day in the Bird\u0027s Nest\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A discus fish\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Carol Roberts, \u0026quot;[http://www.discusnada.org/discus/history.html History of Discus]\u0026quot;, \u0027North American Discus Association\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The main body of the Amazon River is too fast, too deep, and too silt laden for \u0027\u0027discus\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A chakram\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1893\u0027\u0027, Krishna-Swaipayana Vyasa, translated by K. M. Ganguli, \u0027w:The The Mahabharata\u0027, Adi Parva, Section XIX\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"And Narayana instantly cut off with his \u0027\u0027discus\u0027\u0027 the well-adorned head of the Danava who was drinking the Amrita without permission\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1899\u0027\u0027, w:Thomas William Rhys Thomas William Rhys Davids (transl.), \u0027Digha Nikaya\u0027, \u0026quot;s:SamannaPhala Sàmañña-Phàla Sutta\u0026quot\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"If with a \u0027\u0027discus\u0027\u0027 with an edge sharp as a razor he should make all the living creatures on the earth one heap, one mass, of flesh\", \"priority\":16}]}, \"synonyms\":{}}");

	add("discussion", "{\"term\":\"discussion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027discussion\u0027 from {{m|la|discussiō}}, from Latin {{m|la|discutiō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Conversation or debate concerning a particular topic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"There was then a long \u0027\u0027discussion\u0027\u0027 of whether to capitalize words like \u0026quot;east\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This topic is not open to \u0027\u0027discussion\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Text giving further detail on a subject\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Under each heading, you will find a \u0027\u0027discussion\u0027\u0027 section\", \"priority\":5}]}, \"synonyms\":{}}");

	add("disdain", "{\"term\":\"disdain\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027desdeignier\u0027 (modern French \u0027dédaigner\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A feeling of contempt or scorn\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The cat viewed the cheap supermarket catfood with \u0027\u0027disdain\u0027\u0027 and stalked away\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"William Shakespeare, \u0027Much ado about Nothing\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Disdain\u0027\u0027 and scorn ride sparkling in her eyes\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"That which is worthy to be disdained or regarded with contempt and aversion\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Spense\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Most loathsome, filthy, foul, and full of vile \u0027\u0027disdain\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The state of being despised; shame\", \"priority\":8}]}, \"synonyms\":{}}");

