	add("disease", "{\"term\":\"disease\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) {{m|enm|disese}}, from Anglo-norman {{m|fro|desese|desese, disaise}}, from Old french (842-ca. 1400) {{m|fro|desaise}} ({{prefix|dis|ease|lang\u003den}}). Displaced native Middle english (1100-1500) {{m|enm|adle|adle, audle|disease}} (from Old english (ca. 450-1100) {{m|ang|ādl||disease, sickness}}, see {{l/en|adle}}), Middle english (1100-1500) {{m|enm|cothe|cothe, coathe|disease}} (from Old english (ca. 450-1100) {{m|ang|coþu||disease}}, see {{l/en|coath}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An abnormal condition of a human, animal or plant that causes discomfort or dysfunction; distinct from injury insofar as the latter is usually instantaneously acquired\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The tomato plants had some kind of \u0027\u0027disease\u0027\u0027 that left their leaves splotchy and fruit withered\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Diseases\u0027\u0027 desperate grown, / By desperate appliances are relieved\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Jr. (1751-1836\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The instability, injustice, and confusion introduced into the public counsels have, in truth, been the mortal \u0027\u0027diseases\u0027\u0027 under which popular governments have everywhere perished\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dOf all the queer collections of humans outside of a crazy asylum, it seemed to me this sanitarium was the cup winner. […] When you\u0027re well enough off so\u0027s you don\u0027t have to fret about anything but your heft or your \u0027\u0027diseases\u0027\u0027 you begin to get queer, I suppose\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|url\u003dhttp://openlibrary.org/works/OL1521052W|passage\u003d“[…] the awfully hearty sort of Christmas cards that people do send to other people that they don\u0027t know at all well. You know. The kind that have mottoes. And then, when you see [the senders], you probably find that they are the most melancholy old folk with malignant \u0027\u0027diseases\u0027\u0027. […]”\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/the-british-longitude-act-reconsidered The British Longitude Act passage\u003dConditions were horrendous aboard most British naval vessels at the time. Scurvy and other \u0027\u0027diseases\u0027\u0027 ran rampant, killing more seamen each year than all other causes combined, including combat\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Any abnormal or harmful condition, as of society, people\u0027s attitudes, way of living etc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"N.N., \u0027:s:The Urantia Book/Paper 13\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The Urantia Book\u0027, Paper 134:6\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"War is not man\u0027s great and terrible \u0027\u0027disease\u0027\u0027; war is a symptom, a result. The real \u0027\u0027disease\u0027\u0027 is the virus of national sovereignty\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Lack of ease; uneasiness; trouble; vexation; disquiet\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"c.1552 – 1599\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"So all that night they passed in great \u0027\u0027disease\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"to shield thee from \u0027\u0027diseases\u0027\u0027 of the world\", \"priority\":18}]}, \"synonyms\":{}}");

