	add("disestablishment", "{\"term\":\"disestablishment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The separation of church and state; the removal of a policy of having an official governing religion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"As evangelicals defect in one direction and traditionalists in the other, and \u0027\u0027disestablishment\u0027\u0027 beckons with the reform of the House of Lords ... — The Times, October 21, 2009, \u0027Desperate bishops invited Rome to park its tanks on Archbishop’s lawn\u0027 by Ruth Gledhill, Religion Correspondent\", \"priority\":2}]}, \"synonyms\":{}}");

