	add("disguise", "{\"term\":\"disguise\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027disgisen\u0027 \u0027disguisen\u0027 borrowed from Old french (842-ca. 1400) \u0027desguiser\u0027 (modern \u0027déguiser\u0027 , itself derived from \u0027des-\u0027 (dis-) quot; (from Latin \u0027dis-\u0027 + \u0027guise\u0027 (guise) (from a Germanic source).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Attire (e.g. clothing, makeup) used to hide one\u0027s identity or assume another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That cape and mask complete his \u0027\u0027disguise\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The appearance of something on the outside which masks what\u0027s beneath\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act of disguising, notably as a plo\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any \u0027\u0027disguise\u0027\u0027 may expose soldiers to be deemed enemy spies\", \"priority\":5}]}, \"synonyms\":{}}");

