	add("dishabille", "{\"term\":\"dishabille\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027déshabillé\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Extreme casual or disorderly dress, shirt tail out, sleeves unbuttoned, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1817\u0027\u0027, Jane Austen, \u0027Northanger Abbey\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Wherever they went, some pattened girl stopped to curtsy, or some footman in \u0027\u0027dishabille\u0027\u0027 sneaked off. Yet this was an abbey\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1891\u0027\u0027, \u0027Seattle Post-Intelligencer\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A little after 3:15 o’clock yesterday afternoon a stream of people, hatless, coatless, some in an even worse state of \u0027\u0027dishabille\u0027\u0027 rushed down the stairs or to the elevators of every one of the downtown buildings and onto the streets, their faces showing every sign of terror\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A loose, negligent dress\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1919,\u0027\u0027 w:Ronald Ronald Firbank, Valmouth\u0027, Duckworth, hardback edition, page 4\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"She wore a \u0027\u0027dishabille\u0027\u0027 of mignonette-green silk and bead-diapered head-dress that added several inches to her height\", \"priority\":8}]}, \"synonyms\":{}}");

	add("disharmony", "{\"term\":\"disharmony\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|dis|harmony|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The absence of harmony or concordance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Luke Harding and Uki Goni, \u0027Argentina urges UK to hand back Falklands and \u0027end colonialism\u0027 (in \u0027The Guardian\u0027, 3 January 2013)[http://www.guardian.co.uk/uk/2013/jan/02/argentina-britain-hand-back-falklands\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Critics suggest that Fernández, an unashamed populist and nationalist, is seeking to deflect attention from social \u0027\u0027disharmony\u0027\u0027 at home\", \"priority\":3}]}, \"synonyms\":{}}");

