	add("dishonesty", "{\"term\":\"dishonesty\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Old french (842-ca. 1400) \u0027deshonesté\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The characteristic or condition of being dishonest\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1602\u0027\u0027, William Shakespeare, Twelfth Night\u0027, act 3 scene 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027dishonesty\u0027\u0027 appears in leaving his friend here in necessity and denying him\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An act which is fraudulent or otherwise dishonest\", \"priority\":4}]}, \"synonyms\":{}}");

	add("dishonour", "{\"term\":\"dishonour\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027deshonor\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Shame or disgrace\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"You have brought \u0027\u0027dishonour\u0027\u0027 upon the family\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Lack of honour or integrity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Failure or refusal of the drawee or intended acceptor of a negotiable instrument, such as a bill of exchange or note, to accept it or, if it is accepted, to pay and retire it\", \"priority\":4}]}, \"synonyms\":{}}");

