	add("dishwater", "{\"term\":\"dishwater\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Water that dishes and cooking utensils have been washed i\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027dishwater\u0027\u0027 drains into the drywell\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Anything dull and lacking interest or flavou\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This season\u0027s offerings are nothing but \u0027\u0027dishwater\", \"priority\":4}]}, \"synonyms\":{}}");

	add("disilane", "{\"term\":\"disilane\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|di|silane|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The gaseous hydride of silicon SiH\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;-SiH\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;, the silicon analog of ethan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any organic derivative of this compoun\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a molecule with a silicon-silicon single bond, or silicon analog of alkanes\", \"priority\":3}]}, \"synonyms\":{}}");

	add("disilene", "{\"term\":\"disilene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|di|silene|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a molecule containing a silicon atom which forms a double bond to another silicon ato\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a silicon analog of alkenes containing at least one silicon-silicon double bond\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a silicon analog of ethene, Si₂H₄ ( SiH₂\u003dSiH₂\", \"priority\":3}]}, \"synonyms\":{}}");

	add("disillusionment", "{\"term\":\"disillusionment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|dis|illusion|ment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A feeling of disappointment, akin to depression, arising from the realization that something is not what it was expected or believed to be, possibly accompanied by philosophical angst from having one\u0027s beliefs challenged\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1912\u0027\u0027, w:Fyodor Fyodor Dostoevsky, w:Constance Constance Garnett, \u0027s:The Brothers Karamazov/Book V/Chapter The Brothers Karamazov\u0027, Book V, Chapter 3\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But till I am thirty, I know that my youth will triumph over everything- every \u0027\u0027disillusionment\u0027\u0027, every disgust with life\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1917\u0027\u0027, w:John Cowper John Cowper Powys, Travellers\u0027, in Mandragora\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I catch on your face the old sad smile / Of our ancient \u0027\u0027disillusionment\u0027\u0027, / When the ardent crowd tries to beguile / Your world-old soul to impassionment\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1940\u0027\u0027 October, w:Mortimer Mortimer Adler, \u0027s:This Prewar This Prewar Generation\u0027, published in \u0027w:Harper\u0027s Harper\u0027s Magazine\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"They were self-conscious of their \u0027\u0027disillusionment\u0027\u0027 and demoralization, and their spokesmen—the artists and journalists among them—publicized their cynicism so successfully that it came to be regarded as the mood of a whole decade\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1946\u0027\u0027, w:Paramahansa Paramahansa Yogananda, \u0027s:Autobiography of a Yogi/Chapter Autobiography of a Yogi\u0027, Chapter 36: Babaji\u0027s Interest in the West\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Oh, this fair is nothing but a chaos of noise and beggars,\u0027 I thought in \u0027\u0027disillusionment\u0027\u0027. \u0027I wonder if Western scientists, patiently enlarging the realms of knowledge for the practical good of mankind, are not more pleasing to God than these idlers who profess religion but concentrate on alms\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1953\u0027\u0027, w:Dwight D. Dwight D. Eisenhower\u0027, \u0027s:Dwight D. Eisenhower\u0027s First State of the Union First State of the Union Address\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Our country has come through a painful period of trial and \u0027\u0027disillusionment\u0027\u0027 since the victory of 1945. We anticipated a world of peace and cooperation. The calculated pressures of aggressive communism have forced us, instead, to live in a world of turmoil\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The act of freeing from an illusion; the state of being freed therefrom\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1901\u0027\u0027, w:Woodrow Woodrow Wilson, \u0027s:When a Man Comes to When a Man Comes to Himself\u0027, I\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"It is a very wholesome and regenerating change which a man undergoes when he \u0026quot;comes to himself.\u0026quot; It is a process of \u0027\u0027disillusionment\u0027\u0027. The scales have fallen away\", \"priority\":14}]}, \"synonyms\":{}}");

	add("disilyne", "{\"term\":\"disilyne\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|di|silyne|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a molecule containing a silicon atom which forms a triple bond to another silicon ato\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a silicon analog of alkynes containing at least one silicon-silicon triple bond\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a silicon analog of ethyne, Si₂H₂ ( SiH≡SiH\", \"priority\":3}]}, \"synonyms\":{}}");

