	add("disinformation", "{\"term\":\"disinformation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Russian\"], \"text\":\"{{prefix|dis|information|lang\u003den}}, patterned after Russian {{l|ru|дезинформация|дезинформа́ция}}, from French {{l|fr|désinformation}}.\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Intentionally false information disseminated to deliberately confuse or mislead\", \"priority\":1}]}, \"synonyms\":{}}");

