	add("disinsection", "{\"term\":\"disinsection\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|dis|insect|ion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of insecticide for pest control; disinsectization\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1949\u0027\u0027, World Health Organization, \u0027Report on the 1st- Session May 10-15\u0027, [http://books.google.com/books?id\u003dgxVOAAAAYAAJ\u0026amp;q\u003ddisinsection p. 19\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"6.2.3.2.2. For aircraft having pressurized cabins, the \u0027\u0027disinsection\u0027\u0027 of cabins and annexes, cockpit and annexes, is to be carried out after the embarkation of passengers and crew and the closing of the doors and windscreen\", \"priority\":3}]}, \"synonyms\":{}}");

