	add("disinterest", "{\"term\":\"disinterest\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|dis|interest|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"What is contrary to interest or advantage; disadvantage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The absence of bias; impartiality\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, \u0027The Sleepwalkers\u0027, Penguin 2013, p. 125\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He maintained a posture of scrupulous \u0027\u0027disinterest\u0027\u0027 in Balkan affairs […\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A lack of interest; indifference, apathy\", \"priority\":5}]}, \"synonyms\":{}}");

