	add("disintermediation", "{\"term\":\"disintermediation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|dis|intermediation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The removal of funds from a financial institution such as a bank for direct purchase of financial instruments\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The removal of an intermediary from a commercial transaction\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The news industry is undergoing a massive \u0027\u0027disintermediation\u0027\u0027 due to the ubiquitous low-cost communication made possible by the internet\", \"priority\":3}]}, \"synonyms\":{}}");

