	add("disjunct", "{\"term\":\"disjunct\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"dis- + Latin junctus, \u0026quot;joined\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of multiple propositions, any of which, if true, confirm the validity of another proposition (a disjunction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any sentence element that is not fully integrated into the clausal structure of the sentence\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An adverbial that expresses the speaker\u0027s or writer\u0027s attitude towards, or descriptive statement of, the propositional content of the associated clause or sentence\", \"priority\":3}]}, \"synonyms\":{}}");

	add("disjunction", "{\"term\":\"disjunction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027disjunction\u0027 from Latin \u0027disjunctio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"act of disjoining; disunion, separatio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"state of being disjoine\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The proposition resulting from the combination of two or more propositions using the or operator\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a logical operator that results in true when some of its operands are true\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"During meiosis, the separation of chromosomes (homologous in meiosis I, and sister chromatids in meiosis II\", \"priority\":5}]}, \"synonyms\":{}}");

	add("diskindness", "{\"term\":\"diskindness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|dis|kindness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"unkindnes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An unkind act\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1849\u0027\u0027 Southey\u0027s common-place book. Ed. by J.W. Warter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"To do another man a \u0027\u0027diskindness\u0027\u0027 merely because he has done me one, serves to no good purpose, and to many ill ones\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027 John Chardin - Travels in Persia, 1673-167\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"it was in his power to do me great \u0027\u0027diskindnesses\u0027\u0027, if he should take a fancy to it\", \"priority\":6}]}, \"synonyms\":{}}");

	add("dislike", "{\"term\":\"dislike\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|dis|like|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An attitude or a feeling of distaste or aversion\", \"priority\":1}]}, \"synonyms\":{}}");

	add("dislocation", "{\"term\":\"dislocation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"Middle english (1100-1500) from Old french (842-ca. 1400) from stem of \u0027dislocatio\u0027 \u0027delocatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of displacing, or the state of being displaced\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The displacement of parts of rocks or portions of strata from the situation which they originally occupied. Slips, faults, and the like, are dislocations\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of dislocating, or putting out of joint; also, the condition of being thus displaced\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"materials\u0027) A linear defect in a crystal lattice. Because dislocations can shift within the crystal lattice, they tend to weaken the material, compared to a perfect crystal\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A sentence structure in which a constituent that could otherwise be either an argument or an adjunct of a clause occurs outside of and adjacent to the clause boundaries. For example, the sentance, \u0026quot;My father, he is a good man\u0026quot;, is a left dislocation because the constituent \u0026quot;My father\u0026quot; has been moved to the left of the clause \u0026quot;he is a good man\u0026quot;. See\", \"priority\":5}]}, \"synonyms\":{}}");

	add("dislodgement", "{\"term\":\"dislodgement\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|dislodge|ment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or process of being dislodge\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;!-- b.g.c page is mislabeled --\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

	add("disloyalty", "{\"term\":\"disloyalty\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Old french (842-ca. 1400) \u0027desloiauté\u0027 (Modern \u0027déloyauté\u0027 from \u0027des-\u0027 + \u0027loiauté|lang\u003dfro\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of being disloyal; a betrayal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The quality of being disloyal\", \"priority\":2}]}, \"synonyms\":{}}");

	add("dismay", "{\"term\":\"dismay\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027dismayen\u0027 from Anglo-norman {{m|fro|*desmaiier}}, alteration of Old french (842-ca. 1400) \u0027esmaier\u0027 (to frighten) from {{m|la|*exmagare||to deprive (someone) of strength, to disable}}, from \u0027ex-\u0027 + {{m|la|*magare||to enable, empower}}, from Proto-germanic {{m|gem-pro|*maginą}}, {{m|gem-pro|*maganą||might, power}}, from Proto-indo-european {{m|ine-pro|*mēgh-||to be able}}. Akin to Old high german (ca. 750-1050) \u0027magan, megin\u0027 (power, might, main) Old english (ca. 450-1100) {{m|ang|mæġen||might, main}}, Old high german (ca. 750-1050) \u0027magan\u0027 \u0027mugan\u0027 (to be powerful, able) Old english (ca. 450-1100) \u0027magan\u0027 (to be able) More at main, may.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sudden or complete loss of courage and firmness in the face of trouble or danger; overwhelming and disabling terror; a sinking of the spirits; consternation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Condition fitted to dismay; ruin\", \"priority\":2}]}, \"synonyms\":{}}");

	add("dismemberer", "{\"term\":\"dismemberer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|dismember|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, dismembers\", \"priority\":1}]}, \"synonyms\":{}}");

	add("dismissal", "{\"term\":\"dismissal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|dismiss|al|lang\u003den}}. A nineteenth-century coinage (modelled on \u0027\u0027 etc.), replacing the regular form \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of sending someone away\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Deprivation of office; the fact or process of being fired from employment or stripped of rank\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A written or spoken statement of such an act\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Release from confinement; liberation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Removal from consideration; putting something out of one\u0027s mind, mentally disregarding something or someone\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The rejection of a legal proceeding, or a claim or charge made therein\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The event of a batsman getting out; a wicket\", \"priority\":7}]}, \"synonyms\":{}}");

	add("dismission", "{\"term\":\"dismission\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of dismissing or send sending away (someone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Removal from office; termination of employment or services\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1817\u0027\u0027, \u0027Rob Roy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Fairservice looked very blank at this demand, justly considering it as a presage to approaching \u0027\u0027dismission\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The setting aside (of something) from consideration\", \"priority\":5}]}, \"synonyms\":{}}");

	add("dismissiveness", "{\"term\":\"dismissiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|dismissive|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a form of denial, characterized by either passively showing indifference or disregard, or actively dismissing or rejecting ideas or evidence\", \"priority\":1}]}, \"synonyms\":{}}");

	add("dismount", "{\"term\":\"dismount\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"{{prefix|dis|mount|lang\u003den}}, probably a calque of Old french (842-ca. 1400) \u0027desmonter\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The part of a routine in which the gymnast detaches from an apparatus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A stylish routine, let down by a sloppy \u0027\u0027dismount\", \"priority\":2}]}, \"synonyms\":{}}");

	add("disney", "{\"term\":\"disney\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"* From Old french (842-ca. 1400) \u0027de|lang\u003dfro\u0027 () + \u0027isigny\u0027 The place name is from the from the Germanic personal name \u0027Iso\u0027, combined with the Gallo-Roman suffix \u0027-iniacu(m)\u0027. * In modern use, it is also derived from the name of a well-known person called w:Walt Disney|Walt Disney.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"of Norman origin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"w:The Walt Disney The Walt Disney Company, named after w:Walt Walt Disne\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of the theme parks and vacation resorts operated by w:Walt Disney Parks and Walt Disney Parks and Resorts\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, Bill Sample (interviewee), Bill Berkowitz (author), \u0027Local Heroes\u0027, Lexington Books, ISBN 0669158305, page 261\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And they included children down the seashore, they included going to the mountains; our first \u0027\u0027Disney\u0027\u0027 child was not until 1978, no, ’77. I mean, when you say to somebody, “I’m going to give you a trip to \u0027\u0027Disney\u0027\u0027,” or “I’m going to buy you a Cabbage Patch doll,” and we’re doing this for you for absolutely nothing, that’s a reward in itself\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Doug Stumpf, \u0027Confessions of a Wall Street Shoeshine Boy\u0027, HarperCollins, ISBN 0060889543, page 155\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"if they found any phone number from the U.S., anything, they’d deport us right away because we came here on excursion with a whole bunch of people that was going to visit \u0027\u0027Disney\u0027\u0027. That’s what everybody usually do: They say, We going to visit \u0027\u0027Disney\u0027\u0027, and we going to stay there for a week, and then we going to go back, but they end up staying\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Flay Scott, \u0027The Inheritance\u0027, page 3\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Angela asked if we could treat ourselves to a few days at \u0027\u0027Disney\u0027\u0027. The week included a couple of days in \u0027\u0027Disney\u0027\u0027, Dad’s 70\u0026lt;sup\u0026gt;th\u0026lt;/sup\u0026gt; birthday and then the long trip home\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Cleo Stinyard III, \u0027Sex, Love, \u0026amp; Consequences\u0027, ISBN 1440497664, page 213\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"I had decided to take them, my niece, and three nephews to \u0027\u0027Disney\u0027\u0027 in Orlando, FL. I was going to try and make history. I was going to make an attempt at escorting more than four Dredd kids to \u0027\u0027Disney\u0027\u0027 at once and live to tell about it\", \"priority\":11}]}, \"synonyms\":{}}");

	add("disneyfication", "{\"term\":\"disneyfication\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From the US corporation {{suffix|Disney|fication|lang\u003den}}. Compare earlier \u0027\u0027 and later \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process whereby something is disneyfied\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1959\u0027\u0027, Lawrence Lipton, \u0027The Holy Barbarians\u0027, Messner, pp 143–44\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He may even be having his first doubts about the neon chrome artyfake \u0027\u0027Disneyfication\u0027\u0027 of America\", \"priority\":3}]}, \"synonyms\":{}}");

