	add("disobedience", "{\"term\":\"disobedience\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027desobedience\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Refusal to obey\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The teacher complained of the child\u0027s \u0027\u0027disobedience\", \"priority\":2}]}, \"synonyms\":{}}");

	add("disodium", "{\"term\":\"disodium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|di|sodium|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"two atoms of sodium in a compound\", \"priority\":1}]}, \"synonyms\":{}}");

	add("disorder", "{\"term\":\"disorder\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"{{prefix|dis|order|lang\u003den}}. Middle english (1100-1500) \u0027disordeine\u0027 from Old french (842-ca. 1400) \u0027desordainer\u0027 from \u0027disordinare\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Absence of order; state of not being arranged in an orderly manner\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"After playing the children left the room in \u0027\u0027disorder\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A disturbance of civic peace or of public order\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The class was thrown into \u0027\u0027disorder\u0027\u0027 when the teacher left the room\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The army tried to prevent \u0027\u0027disorder\u0027\u0027 when claims the elections had been rigged grew stronger\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A physical or psychical malfunction\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Bulimia is an eating \u0027\u0027disorder\", \"priority\":7}]}, \"synonyms\":{}}");

	add("disorganization", "{\"term\":\"disorganization\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027désorganiser\u0027 Equivalent to {{prefix|dis|organization|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of disorganizing; destruction of system\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being disorganized; as, the disorganization of the body, or of government\", \"priority\":2}]}, \"synonyms\":{}}");

	add("disorientation", "{\"term\":\"disorientation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|dis|orientation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the loss of one\u0027s sense of direction, or of one\u0027s position in relationship with the surrounding\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a state of confusion with regard to time, place or identit\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a delusion\", \"priority\":3}]}, \"synonyms\":{}}");

	add("disorientedness", "{\"term\":\"disorientedness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|disoriented|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being disoriented\", \"priority\":1}]}, \"synonyms\":{}}");

	add("dispalatalization", "{\"term\":\"dispalatalization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"dis- + palatalize + -ation\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the process of becoming not palatal\", \"priority\":1}]}, \"synonyms\":{}}");

	add("disparage", "{\"term\":\"disparage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) \u0027desparager\u0027 from \u0027\u0027 + \u0027parage\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Inequality in marriage; marriage with an inferior\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1596\u0027\u0027, \u0027The Faerie Queene\u0027, IV.8\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But, for his meane degree might not aspire / To match so high, her friends with counsell sage / Dissuaded her from such a \u0027\u0027disparage\u0027\u0027 […\", \"priority\":3}]}, \"synonyms\":{}}");

	add("disparateness", "{\"term\":\"disparateness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|disparate|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the degree to which a thing is disparat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027disparateness\u0027\u0027 of our group was truly our strength\", \"priority\":2}]}, \"synonyms\":{}}");

	add("disparency", "{\"term\":\"disparency\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|disparate|ency|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A significant discrepancy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("disparity", "{\"term\":\"disparity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027disparité\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the state of being unequal; differenc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"incongruity\", \"priority\":2}]}, \"synonyms\":{}}");

	add("dispassion", "{\"term\":\"dispassion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"dis- + passion\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Freedom from passion; an undisturbed state; apathy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("dispensation", "{\"term\":\"dispensation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027despensacion\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of dispensing or dealing out; distribution; often used of the distribution of good and evil by God to man, or more generically, of the acts and modes of his administration\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which is dispensed, dealt out, or appointed; that which is enjoined or bestowe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A system of principles, promises, and rules ordained and administered; scheme; economy; as, the Patriarchal, Mosaic, and Christian dispensations\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The relaxation of a law in a particular case; permission to do something forbidden, or to omit doing something enjoined; specifically, in the Roman Catholic Church, exemption from some ecclesiastical law or obligation to God which a man has incurred of his own free will (oaths, vows, etc\", \"priority\":4}]}, \"synonyms\":{}}");

