	add("dispenser", "{\"term\":\"dispenser\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027dispensour\u0027 from Old french (842-ca. 1400) \u0027despenseor\u0027 from Latin \u0027dispensator\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something or someone that dispenses things\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"date\u003d30 October passage\u003dWhile we know\u0026amp;nbsp;– because the script tells us so\u0026amp;nbsp;– that the people we are watching are in love and in pain and in trouble, they never come across as more than \u0027\u0027dispensers\u0027\u0027 of sparkling aperçus\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An object used to dispense other items\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a toilet-paper \u0027\u0027dispenser\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person who makes up prescriptions, such as an optician or pharmacist\", \"priority\":5}]}, \"synonyms\":{}}");

	add("dispersal", "{\"term\":\"dispersal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or result of dispersing or scattering; dispersion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dPlant breeding is always a numbers game.The wild species we use are rich in genetic variation,\u0026amp;nbsp;[\u0026amp;hellip;]. In addition, we are looking for rare alleles, so the more plants we try, the better. These rarities may be new mutations, or they can be existing ones that are neutral—or are even selected against—in a wild population. A good example is mutations that disrupt seed \u0027\u0027dispersal\u0027\u0027, leaving the seeds on the heads long after they are ripe\", \"priority\":2}]}, \"synonyms\":{}}");

