	add("disquietude", "{\"term\":\"disquietude\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|dis|quietude|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of disquiet, uneasiness, or anxiety\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"but Mr Blifil said, he had received such positive and repeated orders from his uncle, never to keep any secret from him for fear of the \u0027\u0027disquietude\u0027\u0027 which it might give him, that he durst not think of disobedience, whatever might be the consequence\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1795\u0027\u0027, \u0026quot;The Life of John Bunyan,\u0026quot; in the Collins Clear-Type Press ed. of \u0027The Pilgrim\u0027s Progress\u0027, p. xiv\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He was at length called forth, and set apart by fasting and prayer to the ministerial office, which he executed with faithfulness and success during a long course of years; though frequently with the greatest trepidation and inward \u0027\u0027disquietude\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A fear or an instance of uneasiness\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1813\u0027\u0027, Laurence Sterne, \u0027The works of Laurence Sterne: with a life of the author\u0027, Volume 2, page 347\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The cares and \u0027\u0027disquietudes\u0027\u0027 of the marriage-state, quoth Mrs. Wadman, are very great\", \"priority\":7}]}, \"synonyms\":{}}");

