	add("dissemblance", "{\"term\":\"dissemblance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of dissembling\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Dissembling, as a kind of behavior; dissembling, generally\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027 Dec. 22, Virginia Haradon, \u0026quot;[http://www.time.com/time/magazine/article/0,9171,924588,00.html Letters],\u0026quot; \u0027Time\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"With Mae West, coquettish \u0027\u0027dissemblance\u0027\u0027 was out; womanly seductiveness was in\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Dissimilarity, unlikeness\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1849\u0027\u0027, w:James Fenimore James Fenimore Cooper, \u0027The Sea Lions\u0027, ch. 11\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"As this latter animal \u0027[the sperm whale]\u0027 is quite one-third head, he has no very great \u0027\u0027dissemblance\u0027\u0027 to the alligator in this particular\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1916\u0027\u0027 Feb. 7, \u0026quot;[http://paperspast.natlib.govt.nz/cgi-bin/paperspast?a\u003dd\u0026amp;d\u003dHNS19160207.2.4 The Greatest Miracle],\u0026quot; \u0027Hawera \u0026amp; Normanby Star\u0027 (New Zealand), p. 2 \u0026lt;small\u0026gt;(retrieved 12 Aug. 2011)\u0026lt;/small\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Moreover, at any season there is a difference between down grass and mountain grass, between sea grass and valley grass, between moor grass and wood grass. It may be slight, and not in kind but only in shadowy \u0027\u0027dissemblances\u0027\u0027 of texture and hue\", \"priority\":9}]}, \"synonyms\":{}}");

