	add("dissension", "{\"term\":\"dissension\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027dissension\u0027 from Latin \u0027dissensio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of expressing dissent, especially spoken\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Strong disagreement; a contention or quarrel; discord\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1843\u0027\u0027, E.A.Poe, \u0027s:Morning on the Morning on the Wissahiccon\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The natural scenery of America has often been contrasted, in its general features as well as in detail, with the landscape of the Old World—more especially of Europe—and not deeper has been the enthusiasm, than wide the \u0027\u0027dissension\u0027\u0027, of the supporters of each region\", \"priority\":4}]}, \"synonyms\":{}}");

