	add("dissimilation", "{\"term\":\"dissimilation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|dis||lang\u003den}} \u0027\u0027 (-similation) after \u0027assimilation\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of dissimilating, of making dissimilar\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A phenomenon whereby similar consonant or vowel sounds in a word become less similar, resulting in a form that is easier for the listener to perceive\", \"priority\":2}]}, \"synonyms\":{}}");

	add("dissipation", "{\"term\":\"dissipation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|dissiper|tion|lang\u003dfr}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of dissipating or dispersing; a state of dispersion or separation; dispersion; waste\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"without loss or \u0027\u0027dissipation\u0027\u0027 of the matte\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Sir M. Hal\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the famous \u0027\u0027dissipation\u0027\u0027 of mankin\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A dissolute course of life, in which health, money, etc., are squandered in pursuit of pleasure; profuseness in vicious indulgence, as late hours, riotous living, etc.; dissoluteness\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"P. Henr\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"to reclaim the spendthrift from his \u0027\u0027dissipation\u0027\u0027 and extravaganc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A trifle which wastes time or distracts attention\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Jonathan Swif\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Prevented from finishing them [the letters] a thousand avocations and \u0027\u0027dissipations\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A loss of energy, usually as heat, from a dynamic system\", \"priority\":12}]}, \"synonyms\":{}}");

