	add("dissociation", "{\"term\":\"dissociation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|fr|dissociation|lang\u003den}}, from Latin {{m|la|dissociātiō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of dissociating or disuniting; a state of separation; disunion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The process by which a compound body breaks up into simpler constituents; said particularly of the action of heat on gaseous or volatile substances\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027dissociation\u0027\u0027 of the sulphur molecules\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027dissociation\u0027\u0027 of ammonium chloride into hydrochloric acid and ammonia\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A defence mechanism where certain thoughts or mental processes are compartmentalised in order to avoid emotional stress to the conscious mind\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"quot;Project MONARCH could be best described as a form of structured \u0026lt;b\u0026gt;dissociation\u0026lt;/b\u0026gt; and occultic integration, carried out in order to compartmentalize the mind into multiple personalities within a systematic framework.\u0026quot; \u0026amp;mdash;Ron Patton\", \"priority\":6}]}, \"synonyms\":{}}");

