	add("dissolution", "{\"term\":\"dissolution\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027dissolution\u0027 from Latin \u0027dissolutio|lang\u003dla\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The termination of an organized body or legislative assembly, especially a formal dismissal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Disintegration, or decomposition into fragments\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Dissolving, or going into solution\", \"priority\":3}]}, \"synonyms\":{}}");

