	add("distaff", "{\"term\":\"distaff\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027distaf\u0027 () from Old english (ca. 450-1100) \u0027distæf\u0027 (distaff) from Old english (ca. 450-1100) {{m|ang|*dis}} (cognate with Middle Low German \u0027dise\u0027 (lang\u003dgml) + Old english (ca. 450-1100) \u0027stæf\u0027 (lang\u003dang)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a device to which a bundle of natural fibres (often wool, flax, or cotton) are attached for temporary storage, before being drawn off gradually to spin thread. A traditional distaff is a staff with flax fibres tied loosely to it (see Etymology), but modern distaffs are often made of cords weighted with beads, and attached to the wrist\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the part of a spinning wheel from which fibre is drawn to be spu\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"anything traditionally done by or considered of importance to women onl\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a woman, or women considered as a grou\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"His crown usurped, a \u0027\u0027distaff\u0027\u0027 on the throne\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Howel\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Some say the crozier, some say the \u0027\u0027distaff\u0027\u0027 was too busy\", \"priority\":8}]}, \"synonyms\":{}}");

