	add("distaste", "{\"term\":\"distaste\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A feeling of dislike, aversion or antipathy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Aversion of the taste; dislike, as of food or drink; disrelish\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Discomfort; uneasiness\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Prosperity is not without many fears and \u0027\u0027distastes\u0027\u0027, and adversity is not without comforts and hopes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Alienation of affection; displeasure; anger\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"On the part of Heaven, / Now alienated, distance and \u0027\u0027distaste\", \"priority\":8}]}, \"synonyms\":{}}");

