	add("distemper", "{\"term\":\"distemper\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027destemprer\u0027 from Latin \u0027distemperare\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A viral disease of animals, such as dogs and cats, characterised by fever, coughing and catarrh\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A disorder of the humours of the body; a disease\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"my spirits began to sink under the burden of a strong \u0027distemper\u0027, and nature was exhausted with the violence of the feve\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A water-based paint\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dHe looked round the poor room, at the \u0027\u0027distempered\u0027\u0027 walls, and the bad engravings in meretricious frames, the crinkly paper and wax flowers on the chiffonier; and he thought of a room like Father Bryan\u0027s, with panelling, with cut glass, with tulips in silver pots, such a room as he had hoped to have for his own\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A painting produced with this kind of paint\", \"priority\":6}]}, \"synonyms\":{}}");

	add("distention", "{\"term\":\"distention\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027distension\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of distending\", \"priority\":1}]}, \"synonyms\":{}}");

	add("distiller", "{\"term\":\"distiller\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|distill|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who distills, especially alcoholic spirits or hard liquor by a process of distillation; a person who owns, works in or operates a distillery\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A device or apparatus that distills, a condenser; a still\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A company whose business is distilling, especially one that manufactures alcoholic spirits or liquor\", \"priority\":3}]}, \"synonyms\":{}}");

	add("distillery", "{\"term\":\"distillery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|distill|ery|gloss2\u003dplace of|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A place where distillation takes place, especially the distillation of alcoholic spirits\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A company that distills alcohol\", \"priority\":2}]}, \"synonyms\":{}}");

	add("distinction", "{\"term\":\"distinction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) (12th century) \u0027distinction\u0027 from Latin accusative \u0027distinctionem\u0027 action noun of \u0027distinguo\u0027 (i distinguish) Used in English from the late 14th century.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which distinguishes; a single occurrence of a determining factor or feature, the fact of being divided; separation, discrimination\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of distinguishing, discriminating; discrimination\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003dLecture passage\u003dIn spite of these qualifications, the broad \u0027\u0027distinction\u0027\u0027 between instinct and habit is undeniable. To take extreme cases, every animal at birth can take food by instinct, before it has had opportunity to learn; on the other hand, no one can ride a bicycle by instinct, though, after learning, the necessary movements become just as automatic as if they were instinctive\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Specifically, a feature that causes someone or something to stand out as being better; a mark of honour, rank, eminence or excellence; being distinguished\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d2|url\u003dhttp://openlibrary.org/works/OL1521052W|passage\u003dMotherconsidered that the exclusiveness of Peter\u0027s circle was due not to its \u0027\u0027distinction\u0027\u0027, but to the fact that it was an inner Babylon of prodigality and whoredom, from which every Kensingtonian held aloof, except on the conventional tip-and-run excursions in pursuit of shopping, tea and theatres\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Daniel Taylor, \u0027Steven Gerrard goal against Poland ensures England will go to World Cup\u0027 (in \u0027The Guardian\u0027, 15 October 2013)[http://www.theguardian.com/football/2013/oct/15/england-poland-world-cup-qualifier\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Leighton Baines, playing with \u0027\u0027distinction\u0027\u0027 again, sent over a left-wing cross with pace and accuracy. Welbeck, prominently involved all night, could not reach it but Rooney was directly behind him, flashing his header past Szczesny\", \"priority\":7}]}, \"synonyms\":{}}");

	add("distinctiveness", "{\"term\":\"distinctiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|distinctive|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being distinctive, individual or discret\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something which distinguishes something from anything else\", \"priority\":2}]}, \"synonyms\":{}}");

	add("distinguishability", "{\"term\":\"distinguishability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being distinguishable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Michał Horodecki, Seth Lloyd, Andreas Winter - \u0027Quantum coding theorem from privacy and \u0027\u0027distinguishability\u0027\u0027\u0027, Open Systems and Information Dynamics, No. 15 (2008), pp. 47-6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The problem is separated into two parts: proof of \u0027\u0027distinguishability\u0027\u0027 of codewords by receiver, and that of indistinguishability of codewords by environment (privacy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Canadian Grain Commission, \u0027Kernel visual \u0027\u0027distinguishability\u0027\u0027 in western Canadian wheat classes\u0027, 2008-03-0\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This visual characteristic is called kernel visual \u0027\u0027distinguishability\u0027\u0027, or KVD, and it is presently one of the requirements that must be met if a wheat variety is to be registered by the Canadian Food Inspection Agency (CFIA) for unrestricted registration, production and handling\", \"priority\":5}]}, \"synonyms\":{}}");

	add("distinguishment", "{\"term\":\"distinguishment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|distinguish|ment|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A distinction; observation of difference\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1865\u0027\u0027, John Grote, \u0027Exploratio philosophica: rough notes on modern intellectual science, Part 1\u0027, University of Cambridge, page [http://books.google.com/books?id\u003dDlUuAAAAYAAJ\u0026amp;pg\u003dPA50\u0026amp;dq\u003d%22distinguishment%22\u0026amp;hl\u003den\u0026amp;ei\u003d1lazTfqCKIy2sAOuub3pCw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d10\u0026amp;ved\u003d0CFYQ6AEwC\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22distinguishment%22\u0026amp;f\u003dfalse 50\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quot;We notice what we notice and make it \u0027a thing\u0027 distinguishing it from what else is within our view, \u0027partly\u0027 because, doubtless, it is of such or such a size and shape: but we require more impulse to the notice and \u0027\u0027distinguishment\u0027\u0027 than \u0027this\u0027 furnishes.\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1833\u0027\u0027; Samuel Lewis Southard, Joseph Hendrickson, Thomas L. Shotwell, Edward Hopper; \u0027Argument of Samuel L. Southard: in the case of Stacy Decow and Joseph Hendrickson versus Thomas L. Shotwell\u0027, page [http://books.google.com/books?id\u003daiLpM9G98lUC\u0026amp;pg\u003dPA157\u0026amp;dq\u003d%22distinguishment%22\u0026amp;hl\u003den\u0026amp;ei\u003dPFezTaCjN5P4sAOBlonnCw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CDoQ6AEwAzg\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22distinguishment%22\u0026amp;f\u003dfalse 157\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;And first, in your doctrines of God, whom you say is to be known and believed on, as in the \u0027\u0027distinguishment\u0027\u0027 of three persons\", \"priority\":7}]}, \"synonyms\":{}}");

